def atttack(p,q,c,e):
    n = p ** 4 * q
    phi = p ** 3 * (p - 1) * (q - 1)
    d = gmpy2.invert(e,phi)
    m = pow(c,d,n)
    flag = long_to_bytes(m)
    return flag
